import React from "react";
import apple from "../Assest/apple.png";
import mobile from "../Assest/mobile.png";
import { data } from "./Data";
import "./product.css";
import { useDispatch, useSelector } from "react-redux";
import { addToCart, addAllItem } from "../Store/ProductSlice";
import { Handlefavourite } from "../Store/FavouriteSlice";
import { showMore, showLess } from "../Store/VisibilitySlice";

import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faHeart, faShoppingCart } from "@fortawesome/free-solid-svg-icons";

const Product = () => {
  const selector = useSelector((state) => state.visibility.visibleCount);
  const dispatch = useDispatch();

  const add = (item) => {
    dispatch(addToCart(item));
  };

  const handleShowLess = () => {
    if (selector >= data.length) {
      dispatch(showLess(6));
    } else {
      dispatch(showMore(4));
    }
  };
  const buttonText =
    selector >= data.length ? "Hide Product" : "View All Product";

  const addToFavourite = () => {
    dispatch(Handlefavourite());
  };

  const addAllToCart = () => {
    const allItems = data.slice(0, selector);
    dispatch(addAllItem(allItems));
    console.log('items added')
  };

  return (
    <div>
      <div className="container m-auto mt-5 bg-black">
        <div className="grid grid-cols-2 gap-7">
          <div className="flex items-center justify-center mx-5">
            <div>
              <div className="grid-rows-3 flex">
                <div>
                  <img src={apple} alt="iPhone" className="image" />
                </div>
                <div>
                  <p className="text-white pt-3 ps-5">iPhone 14 series</p>
                </div>
              </div>
              <div className="text-white text-6xl pt-3">
                <h1 className="">Up to 10%</h1>
                <h1>off Voucher</h1>
              </div>
              <div className="pt-5">
                <h1 className="text-white border-b-2 border-zinc-600 w-1/4">
                  Shop now
                </h1>
              </div>
            </div>
          </div>
          <div>
            <img src={mobile} alt="Mobile" />
          </div>
        </div>
      </div>
      <div className="container m-auto mt-5">
        <div className="flex items-end justify-end">
          <button className="border px-3 py-3" onClick={addAllToCart}>
            Move All To Cart
          </button>
        </div>
        <div className="row flex flex-wrap">
          {data.slice(0, selector).map((item, index) => (
            <div className="item" key={index}>
              <div className="border h-64 w-70 bg-stone-200">
                <div className="flex items-end justify-end mx-3 mt-3 text-2xl">
                  <FontAwesomeIcon
                    onClick={addToFavourite}
                    className="text-white "
                    icon={faHeart}
                  />
                </div>
                <div className="items-center flex justify-center">
                  <img src={item.image} alt={item.title} />
                </div>
              </div>

              <div className="flex border bg-black py-2 width items-center justify-center">
                <FontAwesomeIcon
                  className="ms-3 ps-3 pr-3 text-white"
                  icon={faShoppingCart}
                />
                <button onClick={() => add(item)} className="text-white">
                  Add to cart
                </button>
              </div>

              <h1 className="pt-2">{item.title}</h1>
              <div className="flex pt-1">
                <p className="text-red-700">${item.newPrice}</p>
                <h1 className="ps-2 line-through">${item.oldPrice}</h1>
              </div>
            </div>
          ))}
        </div>
        <div className="flex justify-center items-center bg-red-600  py-3 text-white w-60 mt-3 mb-4 m-auto">
          <button onClick={handleShowLess}>{buttonText}</button>
        </div>
      </div>
    </div>
  );
};

export default Product;
